	"input[type=hidden]",
	/* Audio player (audio):  */
	".sq-audio-container",
	/* Button Select (atm1d): */
	".sq-atm1d-widget",
	/* Card Sort (cardsort): */ 
	".sq-cardsort",
	/* Card Rating (cardrating): */
